    public void test_PlayerOneWins376Of500Hands() throws Exception
    {
        FiveHundredHands fhh = new FiveHundredHands();

        int count = 0;
        for (FiveHundredHands.Hands hands: fhh.hands)
            if (hands.one.Beats(hands.two))
                ++count;

        assertEquals(376, count);
    }
